import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  return (
    <div className="container">
    <header className="main-header">
      <div className="logo">Sreedeals</div>
      <nav className="nav">
        <ul className="nav-items">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/electronic">Electronic</Link></li>
          <li><Link to="/fasions">Fasions</Link></li>
          <li><Link to="/tech-info">Tech Info</Link></li>
          <li><Link to="/about">About us</Link></li>
          <li><Link to="/privacy">privacy policy</Link></li>
          <li><Link to="/terms">Terms & Conditions</Link></li>
        </ul>
      </nav>
      <div className="search-icon">
        <i className="fa fa-search"><button className='btn btn-dark'>Button</button></i>
      </div>
    </header>
    </div>
  );
};

export default Header;
